unsigned int LS1B(unsigned int x) { return x & (-x); }//取得x的最低位元
unsigned int MS1B(unsigned int x) { // Most Significant 1 Bit (LS1B)函式
	x |= x >> 32; x |= x >> 16; x |= x >> 8;
	x |= x >> 4; x |= x >> 2; x |= x >> 1;
	return (x >> 1) + 1; //可以取得一串位元中最左邊不為零的位元
}
