void ai2()
{
	open = 0xffffffff;
	ch = 0x00000000;
	open ^= piece[15];//非未翻棋
	while (open)
	{
		unsigned int take = LS1B(open);
		open ^= take;
		take = GetIndex(take);
		ch |= pMoves3[take];
	}
	if (piece[15] == 0xffffffff)
	{
		IndexToBoard(9, 9);
		return;
	}
	chess(piece, 0);
	unsigned int hashvalue = myhash(piece);
	search(0, piece, piece_count, -999999, 999999, hashvalue);
	IndexToBoard(srci, dsti);
}

