unsigned int CGen(int ssrc, unsigned int toccupied)
{
	int r = ssrc / 4;//列 
	int c = ssrc % 4;//行 
	unsigned int result = 0;
	unsigned int resulta = 0;
	unsigned int x = ((row[r] & toccupied) ^ (1 << ssrc)) >> (4 * r);//取出跟炮同列 削去炮本身那格
	if (x && c == 0) {
		result |= CGenCL(x);
	}
	else if (x && c == 1) {
		result |= ((x & 12) == 12) ? 8 : 0;
	}
	else if (x && c == 2) {
		result |= ((x & 3) == 3) ? 1 : 0;
	}
	else if (x && c == 3) {
		result |= CGenCR(x);
	}
	result = result << (4 * r);

	x = ((file[c] & toccupied) ^ (1 << ssrc)) >> c;//取出跟炮同行 並全部放到第1行
	if (x && r == 0)
	{
		resulta |= CGenCL(x);
	}
	else if (x && r == 1)
	{
		resulta |= CGenCL(x & 0x11111100);
	}
	else if (x && r == 2)
	{
		unsigned int part = 0;
		if ((x & 0x00000011) == 0x00000011)
			part |= 1;
		resulta |= part | CGenCL(x & 0x11111000);
	}
	else if (x && r == 3)
	{
		unsigned int part = 0;
		part = CGenCR(x & 0x00000111);
		resulta |= part | CGenCL(x & 0x11110000);
	}
	else if (x && r == 4)
	{
		unsigned int part = 0;
		part = CGenCR(x & 0x00001111);
		resulta |= part | CGenCL(x & 0x11100000);
	}
	else if (x && r == 5)
	{
		unsigned int part = 0;
		part = CGenCR(x & 0x00011111);
		resulta |= part | CGenCL(x & 0x11000000);
	}
	else if (x && r == 6)
	{
		resulta |= CGenCR(x & 0x00111111);
	}
	else if (x && r == 7)
	{
		resulta |= CGenCR(x);
	}
	resulta = resulta << c;
	unsigned int re = result | resulta;
	//cout<<hex<<occupied<<" "<<re<<endl;
	//cout<<dec<<r<<" "<<c<<endl;
	return re;
}

unsigned int CGenCL(unsigned int x) {
	if (x) {
		unsigned int mask = LS1B(x); //mask 為炮架的遮罩位置,讓 x 消去炮架。
		return (x ^= mask) ? LS1B(x) : 0; //狀況 5~8 傳回 LS1B(x),狀況 2~4 傳回 0。
	}
	else return 0;
}

unsigned int CGenCR(unsigned int x) {
	if (x) {
		unsigned int mask = MS1B(x); //mask 為炮架的遮罩位置,讓 x 消去炮架。
		return (x ^= mask) ? MS1B(x) : 0; //狀況 5~8 傳回 MS1B(x),狀況 2~4 傳回 0。
	}
	else return 0;
}

int countAva(int pie[14], int deep, unsigned int curPiece[16])//將士相車馬炮兵
{
	int eat[10];
	int power = 0;
	int redleft = 0;
	int blackleft = 0;
	if (color == 0)//紅 
	{
		for (int i = 0; i < 7; i++)
		{
			power += pie[i] * RPower[pie[7]][pie[8]][pie[9]][pie[10]][pie[11]][pie[12]][pie[13]][i];
			redleft += pie[i];
		}
		for (int i = 7; i < 14; i++)
		{
			power -= pie[i] * BPower[pie[0]][pie[1]][pie[2]][pie[3]][pie[4]][pie[5]][pie[6]][i-7];
			blackleft += pie[i];
		}
		if (redleft == 0) power = -100000 + deep * 1000;
		if (blackleft == 0) power = 100000 - deep * 1000;
	}
	else
	{
		for (int i = 7; i < 14; i++)
		{
			power += pie[i] * BPower[pie[0]][pie[1]][pie[2]][pie[3]][pie[4]][pie[5]][pie[6]][i - 7];
			blackleft += pie[i];
		}
		for (int i = 0; i < 7; i++)
		{
			power -= pie[i] * RPower[pie[7]][pie[8]][pie[9]][pie[10]][pie[11]][pie[12]][pie[13]][i];
			redleft += pie[i];
		}
		if (blackleft == 0) power = -100000 + deep * 1000;
		if (redleft == 0) power = 100000 - deep * 1000;
	}
	//------------------------------------------------------判斷距離 
	int distanceScore = 0;
	if (curPiece[15] == 0) {
		if (color == 0)
		{
			for (int i = 1; i < 8; i++)
			{
				if (curPiece[i] && i != 6)//curp!=0 版面上存在
				{
					unsigned int tempcpa = curPiece[i];
					while (tempcpa)
					{
						unsigned int a = LS1B(tempcpa);//一個一個處理 
						tempcpa = tempcpa ^ a;
						for (int ii = i + 7; ii < 15; ii++)
						{
							if (i == 1 && ii == 14) continue;
							if (curPiece[ii])
							{
								unsigned int tempcpb = curPiece[ii];
								while (tempcpb)
								{
									unsigned int b = LS1B(tempcpb);//一個一個處理 
									tempcpb = tempcpb ^ b;

									int ia = GetIndex(a);//得到a的index 0~31 
									int ib = GetIndex(b);//得到b的index 

									int tempS = DistanceP[ia][ib][i - 1][ii - 8];
									distanceScore += tempS;
								}
							}
						}
					}
				}
			}
		}
		else
		{
			for (int i = 8; i < 15; i++)
			{
				if (curPiece[i] && i != 13)//curp!=0 版面上存在
				{
					unsigned int tempcpa = curPiece[i];
					while (tempcpa)
					{
						unsigned int a = LS1B(tempcpa);//一個一個處理 
						tempcpa = tempcpa ^ a;
						for (int ii = i - 7; ii < 8; ii++)
						{
							if (i == 8 && ii == 7) continue;
							if (curPiece[ii])
							{
								unsigned int tempcpb = curPiece[ii];
								while (tempcpb)
								{
									unsigned int b = LS1B(tempcpb);//一個一個處理 
									tempcpb = tempcpb ^ b;
									int ia = GetIndex(a);//得到a的index 0~31
									int ib = GetIndex(b);//得到b的index

									int tempS = DistanceP[ia][ib][i - 8][ii - 1];
									distanceScore += tempS;
								}
							}
						}
					}
				}
			}
		}
	}
	//------------------------------------------------------移動數 
	int movePoint = 0;
	if (curPiece[15] != 0) {
		if (deep % 2 == 0)
		{
			movePoint = AEMindex * 20 + AOMindex - EAEMindex * 50 - EAOMindex;
		}
		else
		{
			movePoint = EAEMindex * 20 + EAOMindex - AEMindex * 50 - AOMindex;
		}
	}
	else {
		if (deep % 2 == 0)
		{
			movePoint = AOMindex - EAEMindex * 80 - EAOMindex;
		}
		else
		{
			movePoint = EAOMindex - AEMindex * 80 - AOMindex;
		}
	}
	//------------------------------------------------------加總
	return power + movePoint - deep + distanceScore;

}

int search(int depth, unsigned int curPiece[16], int curPie[14], int alpha, int beta, unsigned int hashvalue)
{
	TotalSearch++;
	unsigned int hashindex = hashvalue;
	if (hashtable[hashindex].count != 0) {
		HashHit++;
		if (hashtable[hashindex].depth % 2 == depth % 2) {
			HashHitSameTurn++;
			int temp = 0;
			if ((curPiece[0] ^ hashtable[hashindex].curPiece[0]) | (curPiece[7] ^ hashtable[hashindex].curPiece[7])) {
				temp++;
			}
			/*for (int i = 0; i < 16; i++) {
				if (curPiece[i] != hashtable[hashindex].curPiece[i]) {
					temp++;
					break;
				}
			}*/
			if (temp == 0) {
				RealHit++;
				if (hashtable[hashindex].depth < depth) {
					return hashtable[hashindex].count - (depth - hashtable[hashindex].depth);
				}
				else {

				}
			}
		}
	}
	hashtable[hashindex].count = 0;
	chess(curPiece, depth);
	unsigned int taEM[50][2];//存可吃子的方法 0 src 1 dst 避免被往下搜尋時刷掉
	int tAEMi = AEMindex;//alleatmove index
	unsigned int taOM[50][2];//存可移動非吃子的方法 0 src 1 dst
	int tAOMi = AOMindex;//allonlymove index
	int etaemi = EAEMindex;
	if (depth % 2 == 1) etaemi = AEMindex;
	memcpy(taEM, allEatMove, sizeof(taEM));
	memcpy(taOM, allOnlyMove, sizeof(taOM));

	unsigned int weightU[100][2];//計算所有移動與翻棋的得分0src 1dst
	int weight[100];//計算所有移動與翻棋的得分
	int wp = 0;
	int best = -9999999;
	if (depth % 2 == 1)
		best = 9999999;

	for (int i = 0; i < tAEMi; i++)//吃子
	{
		weight[wp] = 0;
		int deeper = depth + 1;
		int c1p, c2p = -1;
		unsigned int c1 = 1 << taEM[i][0];
		unsigned int c2 = 1 << taEM[i][1];
		for (int ii = 1; ii < 15; ii++) {//找到c1 放入c1p  
			unsigned int check = curPiece[ii] & c1;
			if (check != 0) {
				c1p = ii;
				break;
			}
		}
		for (int ii = 1; ii < 15; ii++) {//找c2
			unsigned int check = curPiece[ii] & c2;
			if (check != 0) {
				c2p = ii;
				break;
			}
		}
		if (c2p == -1 || c1p == -1) cout << "err 405";//++++++++++++++++++++++++++++++++++++++++++++
		int c2pcopy;
		c2pcopy = c2p;
		curPiece[c1p] ^= c1;//清除原位置c1
		curPiece[c1p] |= c2;//移動
		curPiece[0] |= c1;//空格+c1
		curPiece[c2p] ^= c2;//清除原位置c2
		curPie[c2p - 1]--;
		weightU[wp][0] = taEM[i][0];
		weightU[wp][1] = taEM[i][1];
		weight[wp] = search(deeper, curPiece, curPie, alpha, beta, hashvalue ^ randtable[c1p - 1][GetIndex(c1)] ^ randtable[c2p - 1][GetIndex(c2)] ^ randtable[c1p - 1][GetIndex(c2)]);
		if (depth == 0)
		{
			int r = rand() % 6;;
			string a[6] = { "☉3☉","(--;)","(〃ω〃)","(’-_-`)","|ω˙）","(*≧艸≦)" };
			cout << a[r] + ".";
		} 
		curPiece[c1p] ^= c2;//清除原位置c2
		curPiece[c1p] |= c1;//移動
		curPiece[0] ^= c1;//空格-c1
		curPiece[c2p] |= c2;//回原位置c2
		curPie[c2p - 1]++;


		if (depth % 2 == 0)//max
		{
			if (weight[wp] > alpha)
			{
				alpha = weight[wp];
			}
			if (weight[wp] > best)
			{
				best = weight[wp];
			}
		}
		else//min
		{
			if (weight[wp] < beta)
			{
				beta = weight[wp];
			}
			if (weight[wp] < best)
			{
				best = weight[wp];
			}
		}
		if (beta <= alpha)
		{
			if (depth % 2 == 0) {//min
				hashtable[hashindex].depth = depth;
				hashtable[hashindex].count = alpha;
				memcpy(hashtable[hashindex].curPiece, curPiece, sizeof(hashtable[hashindex].curPiece));
				return alpha;
			}
			else {//max
				hashtable[hashindex].depth = depth;
				hashtable[hashindex].count = beta;
				memcpy(hashtable[hashindex].curPiece, curPiece, sizeof(hashtable[hashindex].curPiece));
				return beta;
			}
		}
		wp++;
	}

	if (depth >= maxDepth)
	{
		int re = countAva(curPie, depth, curPiece);
		hashtable[hashindex].depth = depth;
		hashtable[hashindex].count = re;
		memcpy(hashtable[hashindex].curPiece, curPiece, sizeof(hashtable[hashindex].curPiece));
		return re;
	}

	for (int i = 0; i < tAOMi; i++)//純移動 --------------------------------------------------------------------------------------------------------
	{
		weight[wp] = 0;
		int deeper = depth + 1;
		int c1p = -1;
		unsigned int c1 = 1 << taOM[i][0];
		unsigned int c2 = 1 << taOM[i][1];
		for (int ii = 1; ii < 15; ii++) {//找兵種
			unsigned int check = curPiece[ii] & c1;
			if (check != 0) {
				c1p = ii;
				break;
			}
		}
		curPiece[c1p] ^= c1;//清除原位置c1
		curPiece[c1p] |= c2;//移動
		curPiece[0] |= c1;//空格+c1
		curPiece[0] ^= c2;//空格-c2

		weightU[wp][0] = taOM[i][0];
		weightU[wp][1] = taOM[i][1];
		weight[wp] = search(deeper, curPiece, curPie, alpha, beta, hashvalue ^ randtable[c1p - 1][GetIndex(c1)] ^ randtable[c1p - 1][GetIndex(c2)]);
		if (depth == 0)
		{
			int r = rand() % 6;;
			string a[6] = { "☉3☉","(--;)","(〃ω〃)","(’-_-`)","|ω˙）","(*≧艸≦)" };
			cout << a[r] + ".";
		}
		curPiece[c1p] ^= c2;//清除原位置c2
		curPiece[0] |= c2;//空格+c2
		curPiece[c1p] |= c1;//移動
		curPiece[0] ^= c1;//空格-c1



		if (depth % 2 == 0)//max
		{
			if (weight[wp] > best)
			{
				best = weight[wp];
			}
			if (weight[wp] > alpha)
			{
				alpha = weight[wp];
			}
		}
		else//min
		{
			if (weight[wp] < best)
			{
				best = weight[wp];
			}
			if (weight[wp] < beta)
			{
				beta = weight[wp];
			}
		}
		if (beta <= alpha)
		{
			if (depth % 2 == 0) {//min
				hashtable[hashindex].depth = depth;
				hashtable[hashindex].count = alpha;
				memcpy(hashtable[hashindex].curPiece, curPiece, sizeof(hashtable[hashindex].curPiece));
				return alpha;
			}
			else {//max
				hashtable[hashindex].depth = depth;
				hashtable[hashindex].count = beta;
				memcpy(hashtable[hashindex].curPiece, curPiece, sizeof(hashtable[hashindex].curPiece));
				return beta;
			}
		}
		wp++;
	}

	if (curPiece[15] != 0)//先試翻棋 做完後call search 
	{
		for (int ssrc = 0; ssrc < 32; ssrc++) { //搜尋盤面上 32 個位置
			if (curPiece[15] & (1 << ssrc) && ch & (1 << ssrc) && depth <= noReDepth) { //若為未翻子 在未翻子的遮罩內 depth<=noReDepth 
				if (depth == 0)
				{
					int r = rand() % 6;;
					string a[6] = { "☉3☉","(--;)","(〃ω〃)","(’-_-`)","|ω˙）","(*≧艸≦)" };
					cout << a[r] + ".";
				}
				weight[wp] = 0;
				int a = 0;
				for (int pID = 0; pID < 14; pID++) { //搜尋可能會翻出之子
					if (DCount[pID]) { //若該兵種可能被翻出
						a += DCount[pID];
						int deeper = depth + 1;
						unsigned int c = 1 << ssrc;
						int cpID = pID + 1;

						curPiece[cpID] |= c;//模擬該兵種翻出來
						curPiece[15] ^= c;

						weightU[wp][0] = ssrc;
						weightU[wp][1] = ssrc;
						weight[wp] += ((DCount[pID]) * search(deeper, curPiece, curPie, -999999, 999999, hashvalue ^ randtable[pID][ssrc] ^ randtable[14][ssrc]));

						curPiece[cpID] ^= c;//將模擬翻出的子復原
						curPiece[15] |= c;
					}
				}
				weight[wp] /= a;
				if (depth % 2 == 0)//max
				{
					if (weight[wp] > alpha)
					{
						alpha = weight[wp];
					}
					if (weight[wp] > best)
					{
						best = weight[wp];
					}
				}
				else//min
				{
					if (weight[wp] < beta)
					{
						beta = weight[wp];
					}
					if (weight[wp] < best)
					{
						best = weight[wp];
					}
				}
				if (beta <= alpha)
				{
					if (depth % 2 == 0) {//min
						hashtable[hashindex].depth = depth;
						hashtable[hashindex].count = alpha;
						memcpy(hashtable[hashindex].curPiece, curPiece, sizeof(hashtable[hashindex].curPiece));
						return alpha;
					}
					else {//max
						hashtable[hashindex].depth = depth;
						hashtable[hashindex].count = beta;
						memcpy(hashtable[hashindex].curPiece, curPiece, sizeof(hashtable[hashindex].curPiece));
						return beta;
					}
				}
				wp++;
			}
		}
	}

	if (curPiece[15] != 0 && depth > noReDepth)//可以走空步
	{
		weightU[wp][0] = 0; weightU[wp][1] = 0; weight[wp] = search(depth + 1, curPiece, curPie, alpha, beta, hashvalue);
		wp++;
	}

	if (depth == 0)//max
	{
		cout << endl << "------------------------------------" << endl;
		int recordi = 0;
		for (int i = wp - 1; i >= 0; i--)
		{
			if (depth == 0)
			{
				cout << weightU[i][0] << " " << weightU[i][1] << " " << weight[i] << endl;
			}
			if (weight[i] == best)
			{
				recordi = i;
				srci = weightU[i][0];
				dsti = weightU[i][1];
			}
		}

		if (draw == 1)
		{
			int loseOne=0;
			unsigned int c1 = 1 << srci;
			for (int ii = 1; ii < 15; ii++) {//找兵種
				unsigned int check = curPiece[ii] & c1;
				if (check != 0) {
					if (ii < 8) {
						loseOne = RPower[curPie[7]][curPie[8]][curPie[9]][curPie[10]][curPie[11]][curPie[12]][curPie[13]][ii-1];
					}
					else {
						loseOne = BPower[curPie[0]][curPie[1]][curPie[2]][curPie[3]][curPie[4]][curPie[5]][curPie[6]][ii - 8];
					}
					break;
				}
			}

			if (best- loseOne < 0); //可能輸 故意平手? 
			else if (srci == past_walk[1][1] && dsti == past_walk[1][0])
			{
				cout << "draw denied" << endl;
				weight[recordi] -= 999999;//可能會贏 選擇不平手? 
				best = weight[0];

				for (int ii = wp - 1; ii >= 0; ii--)//重新尋找 
				{
					if (weight[ii] > best)
					{
						best = weight[ii];
						srci = weightU[ii][0];
						dsti = weightU[ii][1];
					}
				}
			}
		}
	}
	if (wp == 0) best = countAva(curPie, depth, curPiece);
	if (best == 9999999 || best == -9999999) best = countAva(curPie, depth, curPiece);
	hashtable[hashindex].depth = depth;
	hashtable[hashindex].count = best;
	memcpy(hashtable[hashindex].curPiece, curPiece, sizeof(hashtable[hashindex].curPiece));
	return best;
}

