void initial()
{
	random_device rd;
	default_random_engine gen = default_random_engine(rd());
	uniform_int_distribution<unsigned int> dis(0, pow(2, 32) - 1);

	for (int i = 0; i <= 14; i++)
		piece[i] = 0;
	for (int i = 0; i < 15; i++) {
		for (int j = 0; j < 32; j++) {
			randtable[i][j] = dis(gen);
			while (1) {
				int same = 0;
				for (int k = 0; k < i; k++) {
					for (int l = 0; l < i; l++) {
						if (randtable[i][j] == randtable[k][l]) {
							randtable[i][j] = dis(gen);
							same++;
							cout << "randtable repeat" << endl;
						}
					}
				}
				if (!same)
					break;
			}
		}
	}
	red = 0;
	black = 0;
	occupied = 0xFFFFFFFF;
	piece[15] = 0xFFFFFFFF;
	dynamicPower();
	CreateDistanceP();
}

void IndexToBoard(int indexa, int indexb)
{
	stringstream ss;
	string aa;
	int a = indexa / 4;//0~7
	int b = indexa % 4;//0~3 a~d
	if (b == 0) aa = "d";
	else if (b == 1) aa = "c";
	else if (b == 2) aa = "b";
	else if (b == 3) aa = "a";
	ss << 8 - a;
	src = aa + ss.str();
	//cout<<"src : "<<src<<endl;

	stringstream sss;
	a = indexb / 4;//0~7
	b = indexb % 4;//0~3 a~d
	if (b == 0) aa = "d";
	else if (b == 1) aa = "c";
	else if (b == 2) aa = "b";
	else if (b == 3) aa = "a";
	sss << 8 - a;
	dst = aa + sss.str();
	//cout<<"dst : "<<dst<<endl;
}

unsigned int myhash(unsigned int tpiece[16]) {
	unsigned int hashvalue = 0;
	for (int i = 1; i < 16; i++) { //1~14 為雙方兵種 0空格 15 未翻
		unsigned int p = tpiece[i]; //取得棋子位置
		while (p) { //將1~15 號的子都搜尋一遍
			unsigned int mask = LS1B(p); //如果該棋子在多個位置,先取低位元的位置。
			p ^= mask; //除去位於最低位元的該兵種
			hashvalue ^= randtable[i - 1][GetIndex(mask)]; //將最低位元的兵種位置的隨機值xor hashtable
		}
	}
	return hashvalue;
}

